import React from 'react';

function Navbar() {
    return (
        <div>
            <nav className="navbar navbar-light bg-primary-subtle d-flex justify-content-start">
                <img src="https://media.fortniteapi.io/images/594db1146768bade868f7b5f332ad778/transparent.png" alt="mine" width="50px" height="50px" className='ms-5' />
                <h1 className="ms-3">Buscaminas</h1>
            </nav>

        </div>
    );
}

export default Navbar;
